insert  into `aboutus`(`info_id`,`title`,`content`,`ch_id`,`user_id`,`in_date`,`plat_type`) values (9,'厦门瑞宝通','<p>\r\n	<span style=\"font-size: medium\"><strong>瑞宝通（厦门）信息科技有限公司</strong>是厦门一家互联网电子商务技术型公司。</span></p>\r\n<p>\r\n	<span style=\"font-size: medium\">公司拥有互联网核心产品<strong><a href=\"http://www.ruibaotong.net/product/index.html\">瑞宝通JAVA版B2B电子商务系统</a></strong>，为B2B电子商务行业门户网站提供完善的解决方案和技术支持。</span></p>\r\n<p>\r\n	<span style=\"font-size: medium\">公司研发团队拥有多年互联网电子商务开发运营经验，尤其精通JAVA+MySQL下的WEB开发，在WEB标准、用户体验、SEO等领域有独特的研究与经验，并将这些经验与技术融于产品的研发之中。</span></p>\r\n<p>\r\n	<span style=\"font-size: medium\">团队成员全部拥有学士或硕士学历，他们对工作充满激情、思维活跃、敢于挑战，勇于创新，在服务客户方面体现了专业的水准和热情。在公司成立之前，我们的团队已经为国内外数百家网站提供了技术支持或咨询，获得了客户的一致好评。</span></p>\r\n<p>\r\n	<span style=\"font-size: medium\">瑞宝通公司锐意进取，以领先的技术为依托，优质的服务为保证，为国内外数千万企业提供安全、快捷的电子商务服务。</span></p>\r\n<p>\r\n	<span style=\"font-size: medium\">我们对产品追求的终极目标是：做全球最大的电子商务平台提供商。</span></p>\r\n',1,105,'2011-12-23 17:04:14','b2b'),(10,'联系我们','<p>\r\n	<span style=\"font-size: medium\">联系电话：0592-6036010</span></p>\r\n<p>\r\n	<span style=\"font-size: medium\">传真：0592-<!--StartFragment -->6012583</span></p>\r\n<p>\r\n	<span style=\"font-size: medium\"><span style=\"font-size: medium\">客服IM</span>： </span><a href=\"http://wpa.qq.com/msgrd?v=3&amp;uin=2585108896&amp;site=qq&amp;menu=yes\" target=\"_blank\"><span style=\"font-size: medium\"><img alt=\"\" border=\"0\" src=\"http://wpa.qq.com/pa?p=1:2585108896:16\" /></span></a><span style=\"font-size: medium\"> </span><a href=\"http://wpa.qq.com/msgrd?v=3&amp;uin=1552925034&amp;site=qq&amp;menu=yes\" target=\"_blank\"><span style=\"font-size: medium\"><img alt=\"\" border=\"0\" src=\"http://wpa.qq.com/pa?p=1:1552925034:16\" /></span></a><span style=\"font-size: medium\"> </span><a href=\"http://wpa.qq.com/msgrd?v=3&amp;uin=1790340028&amp;site=qq&amp;menu=yes\" target=\"_blank\"><span style=\"font-size: medium\"><img alt=\"\" border=\"0\" src=\"http://wpa.qq.com/pa?p=1:1790340028:16\" /></span></a></p>\r\n<p>\r\