那么该商品将不能进行修改和删除，除非您删除整个订单。 </p>\r\n',1,105,'2012-04-11 15:25:58','b2c'),(22,'新手体验专区','<p>\r\n1、什么时候允许修改订单？\r\n    您在京东下单后，京东商城后台程序会通过一系列算法来判断您的订单是否可以修改，如果可以修改，您在订单操作一列可以看到“修改订单”链接，此时说明订单可以修改。如果没有此链接，说明该订单不可修改。\r\n    一般来说，在您选购的商品没有打印完毕之前，都是可以修改订单的。\r\n2、我能修改订单的哪些内容？\r\n    1)修改购物车内的商品数量，增加或删除商品；（暂不支持添加套装）\r\n    2)修改收货人信息、配送方式、发票信息、订单备注；\r\n    3)添加优惠券或删除已使用的优惠券；\r\n    注：由于目前暂不支持修改支付方式，所以一些与支付方式相关联的收货地址可能也无法修改。\r\n3、修改订单时，订单为什么会被锁定？\r\n    为了避免您在修改订单的同时，您的订单继续被程序处理和执行，我们会在您修改订单过程中锁定您的订单，直到您完成修改并点击了“提交订单”按钮。\r\n    如果您在修改过程当中放弃了修改，建议您返回订单列表页面点击操作栏中的“解锁订单”，否则您的订单将在2个小时后解锁，将影响您订单的生产时间和收货时间。\r\n4、如果购物车里某一款商品下单时的价格和修改订单当时的价格不一致，按哪个来算商品价格呢？\r\n    如果您不修改该商品的购买数量，那么价格和赠品都会维持您下单时的状态不变；\r\n    如果您修改了该商品购买数量或者添加了新商品，那么价格和赠品都会与京东商城最新显示的价格和赠品一致。\r\n    如果您添加了新商品，那么新商品的价格与京东商城最新显示的价格和赠品一致。\r\n5、可以先申请价保后再修改订单吗？\r\n    不可以，如果你对某商品申请了价保，那么该商品将不能进行修改和删除，除非您删除整个订单。 </p>\r\n',1,105,'2012-04-11 15:26:08','b2c'),(23,'24小时在线帮助','<p>\r\n1、什么时候允许修改订单？\r\n    您在京东下单后，京东商城后台程序会通过一系列算法来判断您的订单是否可以修改，如果可以修改，您在订单操作一列可以看到“修改订单”链接，此时说明订单可以修改。如果没有此链接，说明该订单不可修改。\r\n    一般来说，在您选购的商品没有打印完毕之前，都是可以修改订单的。\r\n2、我能修改订单的哪些内容？\r\n    1)修改购物车内的商品数量，增加或删除商品；（暂不支持添加套装）\r\n    2)修改收货人信息、配送方式、发票信息、订单备注；\r\n    3)添加优惠券或删除已使用的优惠券；\r\n    注：由于目前暂不支持修改支付方式，所以一些与支付方式相关联的收货地址可能也无法修改。\r\n3、修改订单时，订单为什么会被锁定？\r\n    为了避免您在修改订单的同时，您的订单继续被程序处理和执行，我们会在您修改订单过程中锁定您的订单，直到您完成修改并点击了“提交订单”按钮。\r\n    如果您在修改过程当中放弃了修改，建议您返回订单列表页面点击操作栏中的“解锁订单”，否则您的订单将在2个小时后解锁，将影响您订单的生产时间和收货时间。\r\n4、如果购物车里某一款商品下单时的价格和修改订单当时的价格不一致，按哪个来算商品价格呢？\r\n    如果您不修改该商品的购买数量，那么价格和赠品都会维持您下单时的状态不变；\r\n    如果您修改了该商品购买数量或者添加了新商品，那么价格和赠品都会与京东商城最新显示的价格和赠品一致。\r\n    如果您添加了新商品，那么新商品的价格与京东商城最新显示的价格和赠品一致。\r\n5、可以先申请价保后再修改订单吗？\r\n    不可以，如果你对某商品申请了价保，那么该商品将不能进行修改和删除，除非您删除整个订单。 </p>\r\n',1,105,'2012-04-11 15:26:15','b2c'),(24,'非会员购物频道','<p>\r\n1、什么时候允许修改订单？\r\n    您在京东下单后，京东商城后台程序会通过一系列算法来判断您的订单是否可以修改，如果可以修改，您在订单操作一列可以看到“修改订单”链接，此时说明订单可以修改。如果没有此链接，说明该订单不可修改。\r\n    一般来说，在您选购的商品没有打印完毕之前，都是可以修改订单的。\r\n2、我能修改订单的哪些内容？\r\n    1)修改购物车内的商品数量，增加或删除商品；（暂不支持添加套装）\r\n    2)修改收货人信息、配送方式、