/*Table structure for table `advinfo` */

DROP TABLE IF EXISTS `advinfo`;

CREATE TABLE `advinfo` (
  `adv_id` int(11) NOT NULL auto_increment,
  `pos_id` int(11) NOT NULL,
  `adv_name` varchar(100) NOT NULL,
  `adv_desc` varchar(200) default NULL,
  `keyword` varchar(100) default NULL,
  `info_id` mediumint(9) default '0',
  `cat_attr` varchar(100) default NULL,
  `adv_code` text,
  `img_path` varchar(100) default NULL,
  `flash_url` varchar(100) default NULL,
  `link_url` varchar(100) default '',
  `title` varchar(100) default NULL,
  `content` varchar(200) default NULL,
  `start_date` datetime NOT NULL,
  `end_date` datetime NOT NULL,
  `remark` varchar(200) default NULL,
  `cust_id` mediumint(9) default NULL,
  `adv_state` char(1) NOT NULL COMMENT '0：已审核 1：审核中',
  `iscount` char(1) NOT NULL COMMENT '0：开启 1：关闭',
  `addnum` int(11) default NULL,
  `area_attr` varchar(100) default NULL,
  PRIMARY KEY  (`adv_id`),
  KEY `pos_id` (`pos_id`)
