/*Table structure for table `advpos` */

DROP TABLE IF EXISTS `advpos`;

CREATE TABLE `advpos` (
  `pos_id` int(11) NOT NULL auto_increment,
  `pos_name` varchar(50) NOT NULL default '',
  `pos_desc` varchar(200) default NULL,
  `pos_type` char(1) NOT NULL COMMENT '见系统参数表',
  `p_width` int(11) default NULL,
  `p_height` int(11) default NULL,
  `module_type` varchar(10) default NULL,
  `price` int(11) NOT NULL,
  `default_code` varchar(200) default NULL,
  `isshow` char(1) NOT NULL,
  `sort_no` int(11) NOT NULL,
  `sys_adv` char(1) NOT NULL default '0',
  `img_path` varchar(100) default '' COMMENT '示意图',
  `adv_pos` char(5) default NULL,
  PRIMARY KEY  (`pos_id`)
