/*Table structure for table `answer` */

DROP TABLE IF EXISTS `answer`;

CREATE TABLE `answer` (
  `answer_id` mediumint(9) NOT NULL auto_increment,
  `ask_id` mediumint(9) default NULL,
  `cust_id` mediumint(9) NOT NULL,
  `answer_desc` varchar(600) NOT NULL,
  `ip` varchar(100) default NULL,
  `refer_data` text NOT NULL,
  `isselect` char(1) NOT NULL default '0' COMMENT '0 ：否 1：是',
  `info_state` char(1) NOT NULL default '0' COMMENT '0：未审核 1：审核通过',
  `in_date` datetime NOT NULL,
  `user_id` mediumint(9) NOT NULL,
  PRIMARY KEY  (`answer_id`),
  KEY `ask_id` (`ask_id`),
  KEY `cust_id` (`cust_id`),
  KEY `info_state` (`info_state`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

