/*Table structure for table `areaset` */

DROP TABLE IF EXISTS `areaset`;

CREATE TABLE `areaset` (
  `areaset_id` mediumint(9) NOT NULL auto_increment,
  `end_area` text NOT NULL,
  `first_price` decimal(10,2) NOT NULL,
  `cont_weight` float NOT NULL,
  `cont_price` decimal(10,2) NOT NULL,
  `first_weight` float NOT NULL,
  `smode_id` char(10) NOT NULL,
  `default_ship` char(1) default '1',
  `ship_id` int(11) NOT NULL,
  PRIMARY KEY  (`areaset_id`)
) ENGINE=MyISAM AUTO_INCREMENT=399 DEFAULT CHARSET=utf8 COMMENT='记录区域设置信息';

/*Data for the table `areaset` */

/*Table structure for table `ask` */

DROP TABLE IF EXISTS `ask`;

CREATE TABLE `ask` (
  `ask_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `cat_attr` varchar(600) NOT NULL,
  `title` varchar(600) NOT NULL,
  `img_path` varchar(100) default NULL,
  `ask_desc` text NOT NULL,
  `add_desc` varchar(300) default NULL,
  `integral` int(11) NOT NULL,
  `is_recom` char(1) NOT NULL COMMENT '0：否 1：是',
  `info_state` char(1) NOT NULL COMMENT '0：未审核 1：审核通过 2：审核不通过 3：禁用',
  `no_reason` varchar(100) default NULL,
  `answer_state` char(1) NOT NULL default '' COMMENT '0：未解决 1：已解决 2：已关闭',
  `in_date` datetime NOT NULL,
  `clicknum` int(11) NOT NULL default '0',
  `fare` int(11) NOT NULL default '0' COMMENT '为0则不收费',
  `user_id` mediumint(9) NOT NULL,
  `infoattr_id` char(10) default NULL,
  PRIMARY KEY  (`ask_id`),
  KEY `cust_id` (`cust_id`),
  KEY `cat_attr` (`cat_attr`(255))
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `ask` */

/*Table structure for table `attrvalue` */

DROP TABLE IF EXISTS `attrvalue`;

CREATE TABLE `attrvalue` (
  `trade_id` char(10) NOT NULL,
  `attr_id` char(10) NOT NULL,
  `attr_value` varchar(60) default NULL,
  PRIMARY KEY  (`trade_id`),
  KEY `attr_id` (`attr_id`)
