/*Table structure for table `audithistory` */

DROP TABLE IF EXISTS `audithistory`;

CREATE TABLE `audithistory` (
  `trade_id` mediumint(9) NOT NULL auto_increment,
  `info_id` mediumint(9) NOT NULL,
  `module_type` varchar(10) NOT NULL COMMENT '表名小写',
  `user_id` mediumint(9) NOT NULL,
  `user_name` varchar(20) NOT NULL,
  `info_state` char(1) NOT NULL COMMENT ' 1：审核通过 2：审核不通过',
  `no_reason` varchar(100) NOT NULL,
  `in_date` datetime NOT NULL,
  `cust_id` mediumint(9) default NULL,
  PRIMARY KEY  (`trade_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='记录模块审核历史';

/*Data for the table `audithistory` */

/*Table structure for table `auditmodel` */

DROP TABLE IF EXISTS `auditmodel`;

CREATE TABLE `auditmodel` (
  `trade_id` mediumint(10) NOT NULL auto_increment,
  `model_type` varchar(20) default NULL,
  `userid` varchar(20) default NULL,
  `username` varchar(50) default NULL,
  `sort_no` varchar(2) default NULL,
  PRIMARY KEY  (`trade_id`)
) ENGINE=MyISAM AUTO_INCREMENT=278 DEFAULT CHARSET=utf8 COMMENT='审核模型';

/*Data for the table `auditmodel` */

/*Table structure for table `banip` */

DROP TABLE IF EXISTS `banip`;

CREATE TABLE `banip` (
  `ip_id` int(11) NOT NULL auto_increment,
  `ip` varchar(60) NOT NULL default '',
  `user_id` mediumint(9) NOT NULL,
  `in_date` datetime NOT NULL,
  PRIMARY KEY  (`ip_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `banip` */

/*Table structure for table `brand` */

DROP TABLE IF EXISTS `brand`;

CREATE TABLE `brand` (
  `brand_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `title` varchar(100) NOT NULL,
  `img_path` varchar(100) NOT NULL,
  `cat_attr` varchar(300) NOT NULL,
  `area_attr` varchar(300) NOT NULL,
  `web_url` varchar(100) NOT NULL,
  `content` text NOT NULL,
  `is_recom` char(1) NOT NULL COMMENT '0：否 1：是',
  `info_state` char(1) NOT NULL default '0' COMMENT '0：未审核 1：审核通过 2：审核不通过 3：禁用',
  `no_reason` varchar(100) default NULL,
  `in_date` datetime NOT NULL,
  `clicknum` int(11) NOT NULL,
  `fare` int(11) NOT NULL default '0' COMMENT '为0则不收费',
  `user_id` mediumint(9) NOT NULL,
  `infoattr_id` char(10) default NULL,
  PRIMARY KEY  (`brand_id`)
) ENGINE=MyISAM AUTO_INCREMENT=70 DEFAULT CHARSET=utf8;

/*Data for the table `brand` */

/*Table structure for table `busimes` */

DROP TABLE IF EXISTS `busimes`;

CREATE TABLE `busimes` (
  `trade_id` mediumint(9) NOT NULL auto_increment,
  `get_cust_id` mediumint(9) NOT NULL,
  `self_cust_id` mediumint(9) NOT NULL,
  `self_user_id` mediumint(9) NOT NULL,
  `get_user_id` mediumint(9) default NULL,
  `msg_content` varchar(600) NOT NULL,
  `msg_date` datetime NOT NULL,
  `re_content` varchar(600) default NULL,
  `re_date` datetime default NULL,
  `is_enable` char(1) NOT NULL default '0' COMMENT '0:有效  1:无效',
  PRIMARY KEY  (`trade_id`)
) ENGINE=MyISAM AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='记录商家留言信息';

/*Data for the table `busimes` */

/*Table structure for table `buy` */

DROP TABLE IF EXISTS `buy`;

CREATE TABLE `buy` (
  `buy_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `title` varchar(600) default '',
  `img_path` varchar(600) default NULL COMMENT '多张图片以，分割',
  `buy_type` char(1) NOT NULL COMMENT '见参数配置表',
  `cat_attr` varchar(600) NOT NULL,
  `area_attr` varchar(600) NOT NULL default '',
  `content` text,
  `buy_num` varchar(50) default NULL,
  `price` varchar(50) default NULL,
  `standard` varchar(50) default NULL,
  `pack` varchar(50) default NULL,
  `end_date` datetime default NULL,
  `is_recom` char(1) NOT NULL COMMENT '0：否 1：是',
  `info_state` char(1) default NULL COMMENT '0：未审核 1：审核通过 2：审核不通过 3：禁用',
  `no_reason` varchar(100) default NULL,
  `in_date` datetime NOT NULL,
  `clicknum` int(11) NOT NULL default '0',
  `fare` int(11) default '0' COMMENT '为0则不收费',
  `user_id` mediumint(9) NOT NULL,
  `infoattr_id` char(10) default NULL,
  PRIMARY KEY  (`buy_id`),
  KEY `cust_id` (`cust_id`),
  KEY `cat_attr` (`cat_attr`(255)),
  KEY `area_attr` (`area_attr`(255)),
  KEY `info_state` (`info_state`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `buy` */

/*Table structure for table `buyeraddr` */

DROP TABLE IF EXISTS `buyeraddr`;

CREATE TABLE `buyeraddr` (
  `addr_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `cust_name` varchar(20) NOT NULL,
  `area_attr` varchar(100) NOT NULL,
  `address` varchar(100) NOT NULL,
  `post_code` varchar(10) NOT NULL,
  `phone` varchar(20) default NULL,
  `cell_phone` varchar(20) default NULL,
  `user_id` mediumint(9) default NULL,
  `in_date` datetime NOT NULL,
  PRIMARY KEY  (`addr_id`),
  KEY `cust_id` (`cust_id`)
) ENGINE=MyISAM AUTO_INCREMENT=176 DEFAULT CHARSET=utf8 COMMENT='买家收货地址表';

/*Data for the table `buyeraddr` */

/*Table structure for table `buyercoupon` */

DROP TABLE IF EXISTS `buyercoupon`;

CREATE TABLE `buyercoupon` (
  `id` mediumint(9) NOT NULL auto_increment,
  `c_id` mediumint(9) default NULL,
  `give_cust_id` mediumint(9) NOT NULL,
  `give_user_id` mediumint(9) NOT NULL,
  `cust_id` mediumint(9) NOT NULL,
  `c_name` varchar(50) NOT NULL,
  `c_img` varchar(60) default NULL,
  `c_type` char(1) NOT NULL COMMENT '0:优惠金额 1:优惠积分 2:优惠折扣',
  `c_money` decimal(10,2) default NULL,
  `c_inter` int(11) default NULL,
  `c_discount` float default NULL,
  `start_time` datetime NOT NULL,
  `end_time` datetime NOT NULL,
  `coupon_times` int(11) NOT NULL default '0',
  `coupon_num` int(11) NOT NULL default '0',
  `is_every` char(1) NOT NULL COMMENT '0:启用 1：禁用',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='记录买家优惠卷拥有信息';

/*Data for the table `buyercoupon` */

/*Table structure for table `category` */

DROP TABLE IF EXISTS `category`;

CREATE TABLE `category` (
  `cat_id` char(10) NOT NULL,
  `cat_name` varchar(50) NOT NULL,
  `en_name` varchar(50) NOT NULL,
  `word_index` char(1) NOT NULL COMMENT '拼音的第一个字母',
  `up_cat_id` char(10) NOT NULL,
  `cat_level` char(1) NOT NULL,
  `module_type` varchar(10) NOT NULL default '' COMMENT '见参数配置表',
  `is_display` char(1) NOT NULL default '' COMMENT '0：隐藏 1：显示',
  `sort_no` int(11) NOT NULL,
  `member_add` char(1) NOT NULL COMMENT '0：允许 1：禁止',
  `seotitle` varchar(100) default NULL,
  `seokeyword` varchar(100) default NULL,
  `seodesc` varchar(200) default NULL,
  `mem_type` varchar(1) default '' COMMENT '0：企业 1：个人 2：不限',
  `cat_intr` text,
  `cat_simple` varchar(200) default NULL,
  PRIMARY KEY  (`cat_id`),
  KEY `module_type` (`module_type`),
  KEY `up_cat_id` (`up_cat_id`)
