/*Table structure for table `complaint` */

DROP TABLE IF EXISTS `complaint`;

CREATE TABLE `complaint` (
  `info_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `comp_type` char(1) NOT NULL,
  `order_id` char(17) default NULL,
  `get_cust_id` mediumint(9) NOT NULL,
  `get_cust_name` varchar(100) NOT NULL,
  `product_name` varchar(100) default NULL,
  `trade_fund` decimal(10,2) NOT NULL,
  `email` varchar(60) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `content` text NOT NULL,
  `file_path` varchar(400) default NULL,
  `comp_path` varchar(400) default NULL,
  `attach_path` varchar(400) default NULL,
  `appeal_desc` text,
  `appeal_date` datetime default NULL,
  `appeal_user_id` mediumint(9) default NULL,
  `do_result` varchar(300) default NULL,
  `user_id` mediumint(9) NOT NULL,
  `state_code` char(1) NOT NULL,
  `in_date` datetime NOT NULL,
  PRIMARY KEY  (`info_id`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='会员投诉信息';

/*Data for the table `complaint` */

/*Table structure for table `coupon` */

DROP TABLE IF EXISTS `coupon`;

CREATE TABLE `coupon` (
  `c_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `c_name` varchar(50) NOT NULL,
  `c_img` varchar(50) default NULL,
  `c_type` char(1) NOT NULL COMMENT '0:优惠金额 1:优惠积分 2:优惠折扣',
  `c_inter` int(11) default NULL,
  `c_money` decimal(10,2) default NULL,
  `c_discount` float default NULL,
  `coupon_times` int(11) NOT NULL default '0',
  `start_time` datetime NOT NULL,
  `end_time` datetime NOT NULL,
  `is_every` char(1) NOT NULL COMMENT '0:通用 1：禁用',
  PRIMARY KEY  (`c_id`)
) ENGINE=MyISAM AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COMMENT='记录优惠卷表信息';

/*Data for the table `coupon` */

/*Table structure for table `creditdetail` */

DROP TABLE IF EXISTS `creditdetail`;

CREATE TABLE `creditdetail` (
  `trade_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `r_type` char(1) NOT NULL COMMENT '见参数配置表',
  `r_name` varchar(50) NOT NULL,
  `r_num` int(11) NOT NULL,
  PRIMARY KEY  (`trade_id`)
) ENGINE=MyISAM AUTO_INCREMENT=114 DEFAULT CHARSET=utf8;

/*Data for the table `creditdetail` */

/*Table structure for table `credithistory` */

DROP TABLE IF EXISTS `credithistory`;

CREATE TABLE `credithistory` (
  `trade_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `c_num` int(11) NOT NULL,
  `r_type` char(1) NOT NULL COMMENT '见参数配置表',
  `reason` varchar(50) NOT NULL,
  `now_num` int(11) NOT NULL,
  `in_date` datetime NOT NULL,
  PRIMARY KEY  (`trade_id`)
) ENGINE=MyISAM AUTO_INCREMENT=218 DEFAULT CHARSET=utf8 COMMENT='记录会员信用指数历史';

/*Data for the table `credithistory` */

/*Table structure for table `download` */

DROP TABLE IF EXISTS `download`;

CREATE TABLE `download` (
  `down_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `title` varchar(600) NOT NULL,
  `img_path` varchar(100) default NULL,
  `cat_attr` varchar(600) NOT NULL,
  `file_path` varchar(300) NOT NULL default '',
  `file_size` float NOT NULL,
  `size_unit` enum('KB','MB','GB','TB') NOT NULL,
  `version` varchar(50) default NULL,
  `update_time` datetime NOT NULL,
  `file_type` varchar(50) NOT NULL COMMENT '见参数配置表',
  `down_desc` text NOT NULL,
  `keyword` varchar(10) default NULL,
  `is_recom` char(1) NOT NULL COMMENT '0：否 1：是',
  `info_state` char(1) default NULL COMMENT '0：未审核 1：审核通过 2：审核不通过 3：禁用',
  `no_reason` varchar(100) default NULL,
  `in_date` datetime NOT NULL,
