insert  into `emailtemplate`(`temp_id`,`temp_name`,`temp_con`,`tag_desc`,`temp_code`,`sys_temp`) values (5,'网站通知模板','<p style=\"text-align: center\">\r\n	<strong><span style=\"font-size: 18px\">《瑞宝通-java版B2B电子商务系统》网站通知</span></strong></p>\r\n<hr />\r\n<p style=\"text-align: center\">\r\n	{content}&nbsp;</p>\r\n<hr />\r\n<p style=\"text-align: center\">\r\n	<a href=\"http://www.ruibaotong.net\">关于我们</a> | <a href=\"http://www.ruibaotong.net/guanyuwomen/contact.html\">联系我们</a></p>\r\n','{content}:邮件内容','web_notice','1'),(8,'会员注册激活账户邮件模板','<p>\r\n	您好{user_name}，欢迎您注册{web_name}，你的密码是{passwd}，请您妥善保存！</p>\r\n<p>\r\n	点击以下链接激活您的账号以完成注册！</p>\r\n<p>\r\n	<a href=\"{cfg_basehost}/portal/member!activeMember.action?user_id={user_id}\">{cfg_basehost}/portal/member!activeMember.action?user_id={user_id}</a></p>\r\n','{user_name}:用户登录名\r\n{web_name}:网站名\r\n{passwd}:登录密码\r\n{user_id}:用户ID\r\n{cfg_basehost}：网站域名，位于系统设置里','reg_active','1'),(10,'测试业务模板','<p>\r\n	测试业务内容</p>\r\n','测试业务注解',NULL,'0'),(11,'找回密码邮件模板','<p>\r\n	您好，{user_name}，您的密码已经重置为{passwd}！</p>\r\n<p>\r\n	请使用此密码返回网站的会员中心修改您的密码，以防账号丢失，谢谢！</p>\r\n','{user_name}：用户登录名\r\n{passwd}：用户密码','forget_passwd','1'),(12,'找回用户名邮件模板','<p>\r\n	您好，{email}，您的用户名是：{user_name}。</p>\r\n','{email}：邮件地址\r\n{user_name}：用户名','forget_username','1'),(17,'商机订阅邮件模版','<p>{info_content}</p>','{info_content}:订阅的内容','subscribe_info','1');

