/*Table structure for table `infoattr` */

DROP TABLE IF EXISTS `infoattr`;

CREATE TABLE `infoattr` (
  `infoattr_id` char(10) NOT NULL,
  `attr_id` char(10) NOT NULL,
  `attr_name` varchar(50) NOT NULL,
  `attr_value` text,
  `sort_no` int(11) NOT NULL,
  `value_id` varchar(100) default NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `infoattr` */

/*Table structure for table `interhistory` */

DROP TABLE IF EXISTS `interhistory`;

CREATE TABLE `interhistory` (
  `trade_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `inter_in` mediumint(9) NOT NULL,
  `inter_out` mediumint(9) NOT NULL,
  `thisinter` mediumint(9) NOT NULL,
  `in_date` datetime default NULL,
  `user_id` mediumint(9) default NULL,
  `reason` varchar(100) default NULL,
  `remark` varchar(100) default NULL,
  `plat_type` char(10) default NULL,
  PRIMARY KEY  (`trade_id`),
  KEY `cust_id` (`cust_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录会员积分异动历史信息';

/*Data for the table `interhistory` */

/*Table structure for table `interrule` */

DROP TABLE IF EXISTS `interrule`;

CREATE TABLE `interrule` (
  `rule_id` int(11) NOT NULL,
  `rule_code` varchar(50) NOT NULL,
  `rule_name` varchar(30) NOT NULL,
  `internum` int(11) NOT NULL,
  PRIMARY KEY  (`rule_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='积分规则表';

