  `is_where` char(1) default '0' COMMENT '0标识国内招聘，1标识海外招聘',
  PRIMARY KEY  (`job_id`),
  KEY `cust_id` (`cust_id`),
  KEY `cat_attr` (`cat_attr`),
  KEY `area_attr` (`area_attr`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

