/*Table structure for table `malllevelset` */

DROP TABLE IF EXISTS `malllevelset`;

CREATE TABLE `malllevelset` (
  `level_id` int(11) NOT NULL auto_increment,
  `level_name` varchar(30) NOT NULL,
  `inter_lower` int(11) NOT NULL,
  `inter_height` int(11) NOT NULL,
  `mem_type` char(1) NOT NULL COMMENT '0:卖家   1:买家',
  `img_url` varchar(100) default NULL,
  `discount` int(11) NOT NULL,
  PRIMARY KEY  (`level_id`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='记录商城会员等级信息';

/*Data for the table `malllevelset` */

/*Table structure for table `mallmemlevel` */

DROP TABLE IF EXISTS `mallmemlevel`;

CREATE TABLE `mallmemlevel` (
  `id` mediumint(9) NOT NULL,
  `cust_id` mediumint(9) NOT NULL,
  `mem_type` char(1) NOT NULL COMMENT '0:卖家  1：买家',
  `level_id` int(11) NOT NULL,
  `start_time` datetime default NULL,
  `end_time` datetime default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='记录商城会员等级表信息';

/*Data for the table `mallmemlevel` */

/*Table structure for table `member` */

DROP TABLE IF EXISTS `member`;

CREATE TABLE `member` (
  `cust_id` mediumint(9) NOT NULL auto_increment,
  `cust_name` varchar(100) NOT NULL default '',
  `logo_path` varchar(100) default NULL,
  `mem_type` char(1) NOT NULL COMMENT '0：企业 1：个人',
  `is_active` char(1) NOT NULL default '0',
  `info_state` char(1) NOT NULL default '' COMMENT '0：未审核 2：审核未通过 1：正常/审核通过 3：禁用',
  `reason` varchar(300) default NULL,
  `cust_rage` char(1) NOT NULL COMMENT '0：供应商；1：采购商；2：二者皆有',
  `cust_supply` varchar(200) default NULL,
  `cust_stock` varchar(200) default NULL,
  `cust_type` char(1) default NULL COMMENT '具体见代码表',
  `client_status` varchar(10) default NULL COMMENT '0：生产加工 1：经销批发 2：招商代理 3：商业服务 4：以上都不是',
  `recommend` char(1) default NULL COMMENT '0：非推荐 1：推荐',
  `cust_key` varchar(200) default NULL,
  `main_product` varchar(200) default NULL,
  `cust_desc` text,
  `cat_attr` varchar(200) default NULL,
  `area_attr` varchar(100) default NULL,
  `address` varchar(200) default NULL,
  `phone` varchar(50) default NULL,
  `fax` varchar(50) default NULL,
  `post_code` varchar(50) default NULL,
  `email` varchar(100) NOT NULL,
  `website` varchar(100) default NULL,
  `contact_name` varchar(50) default NULL,
  `contact_depart` varchar(50) default NULL,
  `contact_job` varchar(50) default NULL,
  `contact_sex` enum('先生','女士') default NULL,
  `contact_cellphone` varchar(50) default NULL,
  `contact_msn` varchar(100) default NULL,
  `contact_qq` varchar(100) default NULL,
  `in_date` datetime default NULL,
  `reg_money_type` varchar(100) default NULL,
  `reg_money` varchar(100) default NULL,
  `reg_date` varchar(100) default NULL,
  `corporate` varchar(100) default NULL,
  `reg_no` varchar(200) default NULL,
  `staff_num` varchar(10) default NULL,
  `brand_name` varchar(200) default NULL,
  `year_sum` varchar(200) default NULL,
  `isoem` varchar(200) default NULL,
  `reg_no_path` varchar(100) default NULL,
  PRIMARY KEY  (`cust_id`),
  KEY `info_state` (`info_state`),
  KEY `cat_attr` (`cat_attr`),
  KEY `area_attr` (`area_attr`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录会员信息表';

