/*Table structure for table `news` */

DROP TABLE IF EXISTS `news`;

CREATE TABLE `news` (
  `news_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `title` varchar(600) NOT NULL,
  `news_attr` varchar(20) default NULL COMMENT 'h：头条 c：推荐 f：幻灯 s：滚动 b：加粗',
  `out_link` varchar(100) default NULL,
  `tag` varchar(100) default NULL COMMENT '多个以，分隔',
  `litpic` varchar(100) default NULL,
  `source` varchar(10) default NULL,
  `sourcelink` varchar(100) default NULL,
  `author` varchar(10) default NULL,
  `cat_attr` varchar(100) default NULL,
  `area_attr` varchar(100) default NULL,
  `content` text NOT NULL,
  `comment` char(1) NOT NULL default '0' COMMENT '0：支持评论 1：禁止评论',
  `sort_no` datetime default NULL,
  `title_color` varchar(10) default NULL,
  `fare` int(11) NOT NULL default '0' COMMENT '为0则不收费',
  `keyword` varchar(50) default NULL,
  `description` varchar(200) default NULL,
  `vote_id` int(11) default NULL,
  `info_state` char(1) NOT NULL default '0' COMMENT '0：未审核 1：通过 2：审核不通过',
  `no_reason` varchar(100) default NULL,
  `is_delete` char(1) default '0' COMMENT '0：未删除 1：已删除',
  `clicknum` int(11) default '0',
  `in_date` datetime NOT NULL,
  `user_id` mediumint(9) NOT NULL,
  `infoattr_id` char(10) default NULL,
  `news_type` varchar(10) default '0',
  PRIMARY KEY  (`news_id`),
  KEY `cust_id` (`cust_id`),
  KEY `cat_attr` (`cat_attr`),
  KEY `info_state` (`info_state`),
  KEY `area_attr` (`area_attr`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `news` */

/*Table structure for table `orderdetail` */

DROP TABLE IF EXISTS `orderdetail`;

CREATE TABLE `orderdetail` (
  `trade_id` mediumint(9) NOT NULL auto_increment,
  `order_id` char(17) NOT NULL,
  `goods_id` mediumint(9) NOT NULL,
  `order_price` decimal(10,2) default NULL,
  `order_num` int(11) default NULL,
  `goods_attr` varchar(300) default NULL,
  `remark` varchar(300) default NULL,
  PRIMARY KEY  (`trade_id`)
) ENGINE=MyISAM AUTO_INCREMENT=328 DEFAULT CHARSET=utf8 COMMENT='记录订单商品详细信息';

/*Data for the table `orderdetail` */

/*Table structure for table `orderhistory` */

DROP TABLE IF EXISTS `orderhistory`;

CREATE TABLE `orderhistory` (
  `info_id` mediumint(9) NOT NULL auto_increment,
  `order_id` char(17) NOT NULL default '',
  `cust_id` mediumint(9) NOT NULL,
  `user_id` mediumint(9) NOT NULL,
  `action_name` varchar(20) NOT NULL,
  `in_date` datetime NOT NULL,
  PRIMARY KEY  (`info_id`),
  KEY `order_id` (`order_id`),
  KEY `cust_id` (`cust_id`)
) ENGINE=MyISAM AUTO_INCREMENT=340 DEFAULT CHARSET=utf8 COMMENT='订单状态历史记录';

/*Data for the table `orderhistory` */

/*Table structure for table `orderinfo` */

DROP TABLE IF EXISTS `orderinfo`;

CREATE TABLE `orderinfo` (
  `order_id` char(17) NOT NULL default '',
  `seller_id` mediumint(9) default NULL,
  `supply_id` mediumint(9) default NULL,
  `cust_name` varchar(100) default NULL,
  `area_attr` varchar(100) default NULL,
  `address` varchar(200) default NULL,
  `post_code` varchar(50) default NULL,
  `phone` varchar(50) default NULL,
  `cell_phone` varchar(50) default NULL,
  `price` decimal(10,2) default NULL,
  `goods_num` int(11) default NULL,
  `carriage_fee` decimal(10,2) default '0.00',
  `goods_fee` decimal(10,2) default NULL,
  `total_fee` decimal(10,2) default NULL,
  `order_state` char(1) default NULL COMMENT '0：等待买家付款；1：等待卖家发货；2：等待买家确认收货；4：交易关闭；5：交易成功；',
  `remark` varchar(500) default NULL,
  `cust_id` mediumint(9) default NULL,
  `user_id` mediumint(9) default NULL,
  `in_date` datetime default NULL,
  `invoice_type` char(1) default NULL COMMENT '0:不开发票1:普通发票2:增值税发票',
  `invoice_top` varchar(300) default NULL,
  `company_name` varchar(50) default NULL,
  `ident_number` varchar(50) default NULL,
  `regis_address` varchar(100) default NULL,
  `regis_tel` varchar(20) default NULL,
  `open_bank` varchar(22) default NULL,
  `bank_account` varchar(100) default NULL,
  `invoice_content` varchar(300) default NULL,
  `smode_id` char(10) default NULL,
  PRIMARY KEY  (`order_id`),
  KEY `cust_id` (`cust_id`),
  KEY `seller_id` (`seller_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';

/*Data for the table `orderinfo` */

/*Table structure for table `ordertrans` */

DROP TABLE IF EXISTS `ordertrans`;

CREATE TABLE `ordertrans` (
  `trans_id` mediumint(9) NOT NULL,
  `cust_id` mediumint(9) default NULL,
  `order_id` char(17) default NULL,
  `order_state` char(1) default NULL,
  `user_id` mediumint(9) default NULL,
  `trans_time` datetime default NULL,
  `reason` varchar(300) default NULL,
  PRIMARY KEY  (`trans_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='记录商品订单异动信息';

/*Data for the table `ordertrans` */

/*Table structure for table `organize` */

DROP TABLE IF EXISTS `organize`;

CREATE TABLE `organize` (
  `org_id` char(10) NOT NULL,
  `org_name` varchar(20) NOT NULL,
  `up_org_id` char(10) NOT NULL COMMENT '1111111111',
  `org_level` int(11) NOT NULL,
  `sys_org` char(1) NOT NULL default '0' COMMENT '0：业务部门 1：系统部门',
  `area_attr` varchar(500) NOT NULL default '',
  `contact` varchar(10) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `cellphone` varchar(20) default NULL,
  `skype` varchar(60) default NULL,
  `qq` varchar(20) default NULL,
  `msn` varchar(60) default NULL,
  `email` varchar(60) default NULL,
  `fax` varchar(20) default NULL,
  `address` varchar(100) default NULL,
  `cat_attr` varchar(100) default NULL,
  PRIMARY KEY  (`org_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='记录组织部门';

/*Data for the table `organize` */

/*Table structure for table `payment` */

DROP TABLE IF EXISTS `payment`;

CREATE TABLE `payment` (
  `pay_id` int(11) NOT NULL auto_increment,
  `pay_code` varchar(50) NOT NULL COMMENT '对应的编码调用相应的支付接口',
  `pay_name` varchar(50) NOT NULL,
  `pay_desc` text,
  `seller_name` varchar(100) NOT NULL,
  `pay_account` varchar(100) NOT NULL,
  `passwd` varchar(100) NOT NULL,
  `hand_fare` int(11) default '0' COMMENT ' 如值为1，则有续费为  1%',
  `enabled` char(1) NOT NULL COMMENT '0：是 1：否',
  PRIMARY KEY  (`pay_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录平台支付方式信息';

