/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `product_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `title` varchar(600) NOT NULL,
  `img_path` varchar(600) default NULL COMMENT '多张图片以，分割',
  `cat_attr` varchar(600) NOT NULL COMMENT '属于多个分类以，分割',
  `attr_desc` text,
  `area_attr` varchar(600) default NULL,
  `model` varchar(50) default NULL,
  `standard` varchar(50) default NULL,
  `brand` varchar(50) default NULL,
  `self_cat_id` mediumint(9) default NULL,
  `content` text,
  `is_recom` char(1) NOT NULL COMMENT '0：否 1：是',
  `info_state` char(1) default NULL COMMENT '0：未审核 1：审核通过 2：审核不通过 3：禁用',
  `no_reason` varchar(100) default NULL,
  `in_date` datetime NOT NULL,
  `clicknum` int(11) NOT NULL default '0',
  `fare` int(11) default '0' COMMENT '为0则不收费',
  `user_id` mediumint(9) NOT NULL,
  `infoattr_id` char(10) default NULL,
  PRIMARY KEY  (`product_id`),
  KEY `cust_id` (`cust_id`),
  KEY `cat_attr` (`cat_attr`(255)),
  KEY `area_attr` (`area_attr`(255))
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

