/*Table structure for table `resume` */

DROP TABLE IF EXISTS `resume`;

CREATE TABLE `resume` (
  `resume_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `resume_name` varchar(600) NOT NULL,
  `cat_attr` varchar(100) NOT NULL,
  `real_name` varchar(10) NOT NULL,
  `img_path` varchar(100) default NULL,
  `sex` enum('男','女') NOT NULL,
  `marry` enum('未婚','已婚') NOT NULL,
  `area_attr` varchar(100) NOT NULL,
  `birth` datetime NOT NULL,
  `height` varchar(10) default NULL COMMENT '单位cm',
  `weight` varchar(10) default NULL COMMENT '单位kg',
  `education` enum('不限','初中','中专','高中','大专','本科','硕士','博士') default NULL,
  `college` varchar(20) NOT NULL,
  `spec` varchar(20) default NULL,
  `salary` varchar(30) default NULL,
  `job_type` enum('不限','全职','兼职','实习') NOT NULL,
  `work_exper` varchar(10) NOT NULL,
  `self_desc` text NOT NULL,
  `technical` varchar(50) default NULL,
  `language` varchar(100) default NULL,
  `cellphone` varchar(20) NOT NULL,
  `email` varchar(60) NOT NULL,
  `phone` varchar(20) default NULL,
  `address` varchar(100) default NULL,
  `qq` varchar(20) default NULL,
  `msn` varchar(60) default NULL,
  `skype` varchar(20) default NULL,
  `is_recom` char(1) NOT NULL COMMENT '0：否 1：是',
  `info_state` char(1) NOT NULL default '' COMMENT '0：未审核 1：审核通过 2：审核不通过 3：禁用',
  `no_reason` varchar(100) default NULL,
  `clicknum` int(11) NOT NULL,
  `fare` int(11) NOT NULL,
  `in_date` datetime NOT NULL,
  `user_id` mediumint(9) NOT NULL,
  `infoattr_id` char(10) default NULL,
  `is_trust` char(1) default '0' COMMENT '0标识个人求职，1标识委托求职',
  PRIMARY KEY  (`resume_id`),
  KEY `cust_id` (`cust_id`),
  KEY `cat_attr` (`cat_attr`),
  KEY `area_attr` (`area_attr`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

