/*Table structure for table `resumeinbox` */

DROP TABLE IF EXISTS `resumeinbox`;

CREATE TABLE `resumeinbox` (
  `inbox_id` mediumint(9) NOT NULL auto_increment,
  `get_cust_id` mediumint(9) NOT NULL,
  `job_id` mediumint(9) NOT NULL,
  `resume_id` mediumint(9) NOT NULL,
  `state` char(1) NOT NULL COMMENT '0：未查看 1：已查看',
  `isinvite` char(1) NOT NULL COMMENT '0：未邀请 1：已邀请',
  `apply_date` datetime NOT NULL,
  `apply_cust_id` mediumint(9) NOT NULL,
  PRIMARY KEY  (`inbox_id`),
  KEY `get_cust_id` (`get_cust_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录简历投递信息';

/*Data for the table `resumeinbox` */

/*Table structure for table `role` */

DROP TABLE IF EXISTS `role`;

CREATE TABLE `role` (
  `role_id` int(11) NOT NULL auto_increment,
  `cust_id` int(11) default NULL,
  `role_name` varchar(20) default NULL,
  `menu_right` text COMMENT '菜单标识串',
  `oper_right` text COMMENT '权限标识串',
  `remark` varchar(200) default NULL,
  PRIMARY KEY  (`role_id`)
