/*Table structure for table `sysmenu` */

DROP TABLE IF EXISTS `sysmenu`;

CREATE TABLE `sysmenu` (
  `menu_id` char(10) collate utf8_bin NOT NULL,
  `menu_name` varchar(20) collate utf8_bin default NULL,
  `syscode` char(3) collate utf8_bin default NULL,
  `up_menu_id` char(10) collate utf8_bin default NULL,
  `menu_level` char(1) collate utf8_bin default NULL,
  `sort_no` int(11) default NULL,
  `enabled` char(1) collate utf8_bin default '0',
  `url` varchar(100) collate utf8_bin default NULL,
  `target` varchar(10) collate utf8_bin default NULL,
  PRIMARY KEY  (`menu_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

