/*Table structure for table `sysmodule` */

DROP TABLE IF EXISTS `sysmodule`;

CREATE TABLE `sysmodule` (
  `module_type` varchar(10) NOT NULL,
  `module_name` varchar(20) NOT NULL,
  `table_name` varchar(10) default NULL,
  `mod_type` char(1) NOT NULL default '1' COMMENT '0：系统模块 1：业务模块，系统模块不允许删除',
  `state_code` char(1) NOT NULL default '0' COMMENT '0：正常 1：禁用',
  `is_catattr` char(1) default '1' COMMENT '0：是 1：否',
  `install_dir` varchar(10) default NULL,
  `link_menu` varchar(300) default NULL,
  `link_table` varchar(100) default NULL,
  `link_file` varchar(600) default NULL,
  `sort_no` int(11) default NULL,
  `is_mem` char(1) NOT NULL,
  `moudleinfo_url` varchar(100) default NULL,
  PRIMARY KEY  (`module_type`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='系统模块表';

