  `domain_type` varchar(1) default '0' COMMENT '0:一级域名 1:二级域名',
  PRIMARY KEY  (`info_id`),
  KEY `cust_id` (`cust_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `topdomain` */

/*Table structure for table `tradecomment` */

DROP TABLE IF EXISTS `tradecomment`;

CREATE TABLE `tradecomment` (
  `trade_id` mediumint(9) NOT NULL auto_increment,
  `order_id` char(17) NOT NULL default '',
  `com_way` char(1) NOT NULL COMMENT '1：买家对卖家 2：卖家对买家',
  `set_cust_id` mediumint(9) NOT NULL,
  `get_cust_id` mediumint(9) NOT NULL,
  `com_type` int(11) NOT NULL,
  `is_score` char(1) NOT NULL default '' COMMENT '1:计分  0：不计分',
  `content` varchar(300) NOT NULL default '',
  `desc_num` int(11) default NULL,
  `service_num` int(11) default NULL,
  `seller_num` int(11) default NULL,
  `ship_num` int(11) default NULL,
  `in_date` datetime NOT NULL,
  PRIMARY KEY  (`trade_id`)
) ENGINE=MyISAM AUTO_INCREMENT=82 DEFAULT CHARSET=utf8 COMMENT='记录交易评价';

/*Data for the table `tradecomment` */

/*Table structure for table `video` */

DROP TABLE IF EXISTS `video`;

CREATE TABLE `video` (
  `video_id` mediumint(9) NOT NULL auto_increment,
  `cust_id` mediumint(9) NOT NULL,
  `title` varchar(600) NOT NULL,
  `img_path` varchar(100) default NULL,
  `cat_attr` varchar(600) NOT NULL,
  `video_path` varchar(500) NOT NULL default '',
  `video_desc` text,
  `keyword` varchar(10) default NULL,
  `is_recom` char(1) NOT NULL COMMENT '0：否 1：是',
  `info_state` char(1) NOT NULL default '0' COMMENT '0：未审核 1：审核通过 2：审核不通过 3：禁用',
  `no_reason` varchar(100) default NULL,
  `in_date` datetime NOT NULL,
  `clicknum` int(11) NOT NULL,
  `fare` int(11) NOT NULL default '0' COMMENT '为0则不收费',
  `user_id` mediumint(9) NOT NULL,
  `infoattr_id` char(10) default NULL,
  PRIMARY KEY  (`video_id`),
  KEY `cust_id` (`cust_id`),
  KEY `cat_attr` (`cat_attr`(255)),
  KEY `info_state` (`info_state`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录视频信息';

/*Data for the table `video` */

/*Table structure for table `vote` */

DROP TABLE IF EXISTS `vote`;

CREATE TABLE `vote` (
  `vote_id` int(11) NOT NULL auto_increment,
  `vote_title` varchar(100) default NULL,
  `start_date` datetime default NULL,
  `end_date` datetime default NULL,
  `is_multi` varchar(20) default NULL COMMENT '1：checkbox 2:radio',
  `vote_count` int(11) default NULL,
  `user_id` char(15) default NULL,
  `in_date` datetime default NULL,
  PRIMARY KEY  (`vote_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='文章分类表';

/*Data for the table `vote` */

/*Table structure for table `vote_log` */

DROP TABLE IF EXISTS `vote_log`;

CREATE TABLE `vote_log` (
  `log_id` int(11) NOT NULL auto_increment,
  `vote_id` int(11) default NULL,
  `ip_addr` varchar(100) default NULL,
  `option_attr` varchar(200) default NULL,
  `log_date` datetime default NULL,
  PRIMARY KEY  (`log_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='在线调查记录表';

/*Data for the table `vote_log` */

/*Table structure for table `vote_option` */

DROP TABLE IF EXISTS `vote_option`;

CREATE TABLE `vote_option` (
  `option_id` int(11) NOT NULL auto_increment,
  `vote_id` int(11) default NULL,
  `option_name` varchar(100) default NULL,
  `option_count` int(11) default NULL,
  PRIMARY KEY  (`option_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='在线调查选项表';

/*Data for the table `vote_option` */

